import React, { useContext, useEffect, useState } from "react";
import GenderGalleryItem from "./GenderGalleryItem"
import { PagesContext } from "../../Context/PagesProvider";
import { NavLink } from 'react-router-dom'
function GenderGallery({ gallery }) {


   console.log("gall: ", gallery);
   async function han() {
      const response = await fetch("http://localhost:3000/DeleteBasket", {
         method: "POST",
         body: JSON.stringify({
            "user_id": "default",
            "basket": [
               {
                  "id": "mfgjgbkdbd",
                  "product_id": "33-2",
                  "size": "44",
                  "amount": "3"
               },
               {
                  "id": "dfmgvgbeokb",
                  "product_id": "27-2",
                  "size": 48,
                  "amount": 1
               }
            ],
            "likes": [
               {
                  "id": "sgojrgjeod03030303",
                  "product_id": "11-2",
                  "size": "44"
               },
               {
                  "id": "s,flrfglw0496",
                  "product_id": "27-2",
                  "size": "M"
               }
            ],
            "order": [
               {
                  "id": "fghgfgd7773455",
                  "send": "true",
                  "num": "34663egrdbd24t535",
                  "local": "Sanct-Peterburg",
                  "sum": "4243",
                  "products": [
                     {
                        "product_id": "02-3",
                        "amout": "3"
                     },
                     {
                        "product_id": "02-2",
                        "amout": "3"
                     }
                  ]
               }
            ]
         }),
         headers: {
            "Content-Type": "application/json"
         }
      })
      console.log(response);
   }
   return (
      <div class="gallery">
         <div class="container">
            <div class="gallery__title">Выберите категорию</div>
            <div class="gallery__block">
               {gallery.map((item) => {
                  console.log(item.img);
                  return <GenderGalleryItem key={item.id} filter={item.filter} img={item.img} title={item.title} />
               })}
            </div>
            <div onClick={han} class="gallery__btn">
               <p class="gallery__link">Купить</p>
            </div>
         </div>
      </div>
   )
}
export default GenderGallery
